import React from "react";
import "../style/Card.css";
import Details from "./Details";
import { useNavigate, Routes, Route, Link, Router } from "react-router-dom";
import { Home } from "../Home";

function Card({ movie }) {
  <BrowserRouter>
    <Routes>
      <Route exact path="/detail" element={<Details/>}/>
    </Routes>
  </BrowserRouter>
  const handleClick = (movie) => {
    console.log("Clicked");
    console.log(movie.title);
  };
  return (
    <Link to="/detail">
      <div>
        <div className="img-card" onClick={() => handleClick(movie)}>
          <div className="card-title">{movie.title}</div>
          <img src={require("../images/one.jpg")} width={280} />
        </div>
      </div>
    </Link>
  );
}

export default Card;
